import React from 'react'

import './input.css'

const Input = (props) => {
  return (
    <div className={props.mainCN}>
      <label>
        <input className={props.cN} name={props.name} type={props.type} placeholder={props.placeHolder} value={props.value}></input>
      </label>
    </div>
  )
}
Input.defaultProps = { type: "text", placeHolder: ""};

export default Input
